import React, { useState, useEffect } from 'react';
import { MapPin, User, Menu } from 'lucide-react';

const NomadWorkspaceFinder = () => {
  // State to track current step in the questionnaire
  const [currentStep, setCurrentStep] = useState('location');
  const [userPreferences, setUserPreferences] = useState({
    location: '',
    maxCommuteTime: 30,
    spaceType: 'cafe',
    noiseLevel: 'moderate',
    paidAccess: 'no',
    foodOptions: 'some',
    workspaceSize: 'medium',
    amenities: {
      printers: false,
      coffee: false,
      wifi: true,
      other: '',
    },
    workdays: {
      sunday: false,
      monday: true,
      tuesday: true,
      wednesday: true,
      thursday: true,
      friday: true,
      saturday: false,
    },
    workTimes: {
      start: '09:00',
      end: '17:00',
    },
    industry: '',
    workInvolves: '',
  });

  // State for map/results view
  const [showResults, setShowResults] = useState(false);
  const [workspaces, setWorkspaces] = useState([]);
  const [loading, setLoading] = useState(false);
  const [selectedWorkspace, setSelectedWorkspace] = useState(null);

  // Handle form input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setUserPreferences({
      ...userPreferences,
      [name]: value,
    });
  };

  // Handle workspace selection
  const handleWorkspaceSelect = (workspace) => {
    setSelectedWorkspace(workspace);
  };

  // Handle checkbox changes for amenities
  const handleAmenityChange = (e) => {
    const { name, checked } = e.target;
    setUserPreferences({
      ...userPreferences,
      amenities: {
        ...userPreferences.amenities,
        [name]: checked,
      }
    });
  };

  // Handle checkbox changes for workdays
  const handleWorkdayChange = (e) => {
    const { name, checked } = e.target;
    setUserPreferences({
      ...userPreferences,
      workdays: {
        ...userPreferences.workdays,
        [name]: checked,
      }
    });
  };

  // Handle work time changes
  const handleTimeChange = (e) => {
    const { name, value } = e.target;
    setUserPreferences({
      ...userPreferences,
      workTimes: {
        ...userPreferences.workTimes,
        [name]: value,
      }
    });
  };

  // Navigate to next step
  const handleNext = () => {
    if (currentStep === 'location') {
